import React from 'react';

const Watched = () => {
    return (
        <div style={{backgroundImage: `url("https://weberr-screenshots.s3.ap-south-1.amazonaws.com/jadark.png")`, height: '100vh', backgroundRepeat: 'no-repeat', backgroundSize: 'cover', backgroundPosition: 'center', position: 'relative'}}>
            <div style={{color: 'white', textAlign: 'center', paddingTop: '20px', fontWeight: 'bold'}}>Our Hall of Fame</div>
        </div>
    )
}

export default Watched;
